import './App.css';
import DiaryEditor from './DiaryEdtor';
import DiaryList from './DiaryList';
function App() {
  const dummyList = [
    {
      id : new Date().now,
      author : '유호준',
      content : '더미 일기 1',
      emotion : 5,
      created_date : new Date().getTime(),
    },
    {
      id : new Date().now(),
      author : '홍길동',
      content : '더미 일기 2',
      emotion : 3,
      created_date : new Date().getTime(),
    },
    {
      id : new Date().now(),
      author : '아무개',
      content : '더미 일기 3',
      emotion : 2,
      created_date : new Date().getTime(),
    },
  ];
  return (
    <div className="App">
      <DiaryEditor/>
      <DiaryList diaryList={dummyList}/>
    </div>
  );
}

export default App;
